import * as React from 'react';
import Box from '@mui/material/Box';
import FormControl from '@mui/material/FormControl';
import Input from '@mui/material/Input';
import InputLabel from '@mui/material/InputLabel';
import { Typography } from '@mui/material';
import Button from '@mui/material/Button';

export default function AddPetForm() {
  return (
    <div>
      <Box
        component="form"
        sx={{
          '& > :not(style)': { m: 1 },
        }}
        noValidate
        autoComplete="off"
      >
        <Typography variant="h6">Enter New Pet Info</Typography>
        <FormControl variant="standard">
          <InputLabel htmlFor="component-simple">Name</InputLabel>
          <Input id="petNameInput" />
        </FormControl>
        <FormControl variant="standard">
          <InputLabel htmlFor="component-simple">Age</InputLabel>
          <Input id="petAgeInput" />
        </FormControl>
        <FormControl variant="standard">
          <InputLabel htmlFor="component-simple">Species</InputLabel>
          <Input id="petSpeciesInput"  />
        </FormControl>
      </Box>
      <Button>Add Pet</Button>
    </div>
  );
}
